import { GenericPlant } from './'

 export default function getSeed(seed) {

   switch(seed) {
     case "generic_plant":
        return {bloom: 1, leafColour: '', stemColour: '', flowerColour: ''}
     case "tulip":
        return {bloom: 2, leafColour: '#2D5A27', stemColour: '#567d46', flowerColour: '#ff878d'}

     default:
      return
   }

}
